public boolean remove(final Object key) {
  // validate key
  if (key == null) {
    throw new IllegalArgumentException("Null element is not supported.");
  }
  LinkedElement<T> removed = removeElem((T) key);
  shrinkIfNecessary();
  return removed == null ? false : true;
}
